    public int lengthOfLongestSubstring5(String s) {
        int n = s.length();
        int ans = 0;
        for (int i = 0; i < n; i++)
            for (int j = i + 1; j <= n; j++)
                if (allUnique(s, i, j)) ans = Math.max(ans, j - i);
        return ans;
    }

    public boolean allUnique(String s, int start, int end) {
        Set<Character> set = new HashSet<>();
        for (int i = start; i < end; i++) {
            Character ch = s.charAt(i);
            if (set.contains(ch)) return false;
            set.add(ch);
        }
        return true;
    }

	
	
    public int lengthOfLongestSubstring4(String s) {
        Map<Character,Integer> map = new HashMap<>(Math.max(16,(int)(s.length() / 0.75) + 1));
         int start = 0;
         int end = 0;
         int result = 0;
         for (;end<s.length();end++) {
             if (map.containsKey(s.charAt(end))) {
                 if (start <= map.get(s.charAt(end))) {
                     start = map.get(s.charAt(end)) + 1;
                 }
             }
             map.put(s.charAt(end),end);
             result = Math.max(result,end - start + 1);
         }
         return result;
     }

    public int lengthOfLongestSubstring(String s) {
    	
    	if(s == null || s.length()==0){
    		return 0 ;
    	}
    	// abcabcaa
    	List<String> list = new ArrayList<String> ();
    	for(char c :s.toCharArray()){
    		String sc = String.valueOf(c) ;
    		list.add(sc) ;
    	}
    	
    	// jiequ
    	List<String> subStringList = new ArrayList<String> ();

    	int index = 0;
    	int length = s.toCharArray().length ;
    	
    	while(index<=length){
    		for(int i=index;i<=length;i++){
    			String ss = s.substring(index,i);
    			boolean repeat = false;
    			for(String l :list){
    				if(ss.indexOf(l)!=ss.lastIndexOf(l)){
    					repeat = true;
    					break;
    				}
    			}
    			if(!repeat){
    				subStringList.add(ss) ;
    			}
    		}
    		index ++ ;
    	}
    	int maxLength = 0 ;
    	String maxSubString = "";
    	for(String ms:subStringList){
    		if(ms.length()>maxLength){
    			maxLength = ms.length() ;
    			maxSubString = ms ;
    		}
    		
    	}
    	System.out.println(maxSubString);
    	return maxLength ;   
    }
